function getColorEcorregiones(NOMBRE_ECO) {
    switch (NOMBRE_ECO) {
        case 'Altos Andes':
            return { color: "#FFFFCC" };
        case 'Puna':
            return { color: "#C0C0C0" };
        case 'Monte de Llanuras y Mesetas':
            return { color: "#EEDD82" };
        case 'Estepa Patagonica':
            return { color: "#DAA520" };
        case 'Monte de Sierras y Bolsones':
            return { color: "#A52A2A" };
        case 'Chaco Seco':
            return { color: "#D2691E" };
        case 'Espinal':
            return { color: "#A0522D" };
        case 'Pampa':
            return { color: "#F4A460" };
        case 'Chaco Humedo':
            return { color: "#9ACD32" };
        case 'Campos y Malezales':
            return { color: "#ADFF2F" };
        case 'Bosque Patagonicos':
            return { color: "#6B8E23" };
        case 'Selva Paranaense':
            return { color: "#228B22" };
        case 'Selva de las Yungas':
            return { color: "#006400" };
        case 'Esteros del Ibera':
            return { color: "#556B2F" };
        default:
            return { color: "#000000" }; // Color por defecto si no hay coincidencia
    }
}


function styleEco(feature) {
    const { color } = getColorEcorregiones(feature.properties.NOMBRE_ECO);
    return {
      color: color,
      weight: 2,
      opacity: 0.9,
      dashArray: "0",
      fillOpacity: 0.9,
    };
  }

// Contenido del popup para cada feature
